            false,
            ['decrypt']
        );
        const decrypted = await window.crypto.subtle.decrypt(
            {
                name: 'AES-GCM',
                iv: ivBytes,
                tagLength: 128,
            },
            derivedKey,
            encryptedWithTag
        );
        const decoder = new TextDecoder();
        return decoder.decode(decrypted);
    }
    
    function getPinInput(idx) {
        return document.querySelector(`.pin input#pin${idx}`);
    }

</script>
